import './style.css';
import InputField from '../../../common/form-fields/InputField';

const ItemOptions = (tracked, expectedPrice, onChange) => {
  return (
    <div className="item-options">
      <div className="tracked-field">
        <label class="checkbox-toggle">
          <input type="checkbox" id="tracked-checkbox" checked="True" />
          <span class="slider round"></span>
        </label>
      </div>
      {/* <InputField
        label="Tracked"
        type="checkbox"
        inputName="tracked"
        checked={tracked}
        onChange={onChange}
      />
      <InputField
        label="Expected price"
        type="text"
        inputName="expectedPrice"
        value={expectedPrice}
        onChange={onChange}
      /> */}
    </div>
  );
};

export default ItemOptions;
